import React from 'react'

function Navbar() {
    return (
        <nav 
            className='d-flex justify-content-center align-items-center'
            style={{
                position: 'fixed',
                backgroundColor: 'salmon',
                height: '100vh',
                width: '80px'
            }}
        >
            <ul 
                style={{
                    width: '90%',
                    backgroundColor: '#fff'
                }}
            >

            </ul>
        </nav>
    )
}

export default Navbar
